package in.twizmwaz.cardinal.tabList.entries;

import com.mojang.authlib.properties.Property;
import in.twizmwaz.cardinal.module.modules.team.TeamModule;
import org.bukkit.ChatColor;
import org.bukkit.entity.Player;

import java.util.Arrays;
import java.util.List;

public class TeamTabEntry extends SkinTabEntry {

    private static final List<Property> coloredSkins = Arrays.asList(
            /*0, black*/       new Property("textures", "", ""),
            /*1, dark blue*/   new Property("textures", "", ""),
            /*2, dark green*/  new Property("textures", "", ""),
            /*3, dark aqua*/   new Property("textures", "", ""),
            /*4, dark red*/    new Property("textures", "", ""),
            /*5, dark purple*/ new Property("textures", "", ""),
            /*6, gold*/        new Property("textures", "", ""),
            /*7, gray*/        new Property("textures", "", ""),
            /*8, dark gray*/   new Property("textures", "", ""),
            /*9, blue*/        new Property("textures", "", ""),
            /*a, green*/       new Property("textures", "", ""),
            /*b, aqua*/        new Property("textures", "", ""),
            /*c, red*/         new Property("textures", "", ""),
            /*d, light purple*/new Property("textures", "", ""),
            /*e, yellow*/      new Property("textures", "", ""),
            /*f, white*/       new Property("textures", "", "")
    );

    private TeamModule team;

    public TeamTabEntry(TeamModule team) {
        super(getProfile(coloredSkins.size() > team.getColor().ordinal()
                ? coloredSkins.get(team.getColor().ordinal()) : DEFAULT_PROPERTY));
        this.team = team;
        load();
    }

    @Override
    public String getDisplayName(Player viewer) {
        return team.size() + "" + ChatColor.DARK_GRAY + "/" + ChatColor.GRAY + team.getMax() + " " + team.getColor() + ChatColor.BOLD + team.getName(viewer.getLocale());
    }

}
